CsrUint16 serialise_unifi_mgt_ibss_station_ind(CsrUint8** resultBuffer, CsrUint16 appHandlesCount, void* *appHandles, const unifi_MACAddress *address, CsrBool isconnected)
{
    CsrUint16 packedLength = 0;
    CsrUint32 packedSize = 6;
    CsrUint8* evt;
    CsrUint8* buffer;

    /* Calc Dymanic Size */
    packedSize += 2;
    if (appHandlesCount)
    {
        CsrUint16 i1;
        for(i1 = 0; i1 < appHandlesCount; i1++)
        {
            packedSize += 4;
        }
    }
    packedSize += 6;
    packedSize += 2;

    evt = (CsrUint8*)CsrPmalloc(packedSize);
    buffer = evt;
    packedLength += event_pack_CsrUint16(&buffer, UNIFI_MGT_IBSS_STATION_IND_ID);
    packedLength += event_pack_CsrUint16(&buffer, 0);
    packedLength += event_pack_CsrUint16(&buffer, 0);
    packedLength += event_pack_CsrUint16(&buffer, appHandlesCount);
    if (appHandlesCount)
    {
        CsrUint16 i1;
        for(i1 = 0; i1 < appHandlesCount; i1++)
        {
            packedLength += event_pack_CsrUint32(&buffer, (CsrUint32)appHandles[i1]);
        }
    }
    packedLength += event_pack_buffer(&buffer, address->data, 6);
    packedLength += event_pack_CsrUint16(&buffer, (CsrUint16)isconnected);

    *resultBuffer = evt;
    return packedLength;
}

